package qms.model;


public class SuppilerCategory {
	private String id;
	
	private String category;

	public SuppilerCategory() {
		super();
		// TODO Auto-generated constructor stub
	}

	public SuppilerCategory(String id, String category) {
		super();
		this.id = id;
		this.category = category;
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public String getCategory() {
		return category;
	}

	public void setCategory(String category) {
		this.category = category;
	}
	
	
	
	
	
	
	

}
